import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import React from "react";

const App = () => {
  return (
    <Router>
      <div>
        <h1>Router Test</h1>
        <Routes>
          <Route path="/" element={<div>Home Page Test</div>} />
          <Route path="/login" element={<div>Login Page Test</div>} />
          <Route path="/register" element={<div>Register Page Test</div>} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
